import React, { Component } from "react";


class QuickLinks extends Component {
    render() {
        return (
            <div id="footer" className="d-flex flex-column">
                <div class="header d-inline-flex px-2 pt-4">
                    <h4></h4>
                </div>
            </div>
        );
    }
}


export default QuickLinks;
